import React, { Component } from "react";
class CHeader extends Component {
  state = {};
  render() {
    return (
      <div className="re">
        <div>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <br></br>
          <h1 className="title">Get the Facts About Coronavirus</h1>
          <hr className="my-4"></hr>
          <h3 className="w">
            Take steps to care for yourself and help protect others in your home
            and community.
          </h3>
        </div>
      </div>
    );
  }
}

export default CHeader;
